import "./index.css"
import Card from "./Card"
import Sdata from "./Sdata"


const App = () => {
    return (
        <>
            <Card
                imgsrc={Sdata[0].imgsrc}
                title={Sdata[0].title}
                title1={Sdata[0].title1}
            />
            Sdata.map(ncard)
            


        </>
    )
}

export default App
